function fibonacci(num) {
  if (num === 0 || num === 1) {
    return 1;
  }
  return fibonacci(num - 1) + fibonacci(num - 2);
}

function selectionSort(arr=[]) {
  for (let i = 0; i < arr.length - 1; ++i) {
    for (let j = i + 1; j < arr.length; ++j) {
      [arr[i], arr[j]] = [arr[j], arr[i]];
    }
  }
}

function isPrime(num) {
  if (num < 2) {
    return false;
  }
  for (let i = 2; i * i <= num; ++i) {
    if (num % i === 0) {
      return false;
    }
  }
  return true;
}

function insertionSort(arr=[]) {
  let key, j;
  for (let i = 1; i < arr.length; ++i) {
    key = arr[i];
    j = i - 1;
    while (j >= 0 && arr[j] > key) {
      arr[j + 1] = arr[j];
      --j;
    }
    arr[j + 1] = key;
  }
}

function binarySearch(arr=[], key) {
  let l = 0, r = arr.length - 1;
  while (l < r) {
    let mid = (l + r) / 2;
    if (arr[mid] === key) {
      return mid;
    }
    else if (arr[mid] > key) {
      r = mid - 1;
    }
    else {
      l = mid + 1;
    }
  }
  return -1;
}

function bfs(source, graph=[]) {
  let visited = graph.map(() => false);
  let path = graph.map(() => -1);
  let traversal = [];
  
  visited[source] = true;
  traversal.push(source);

  while (!(traversal.length === 0)) {
    let u = traversal.shift();

    for (let v of graph[u]) {
      if (!visited[v]) {
        traversal.push(v);
        visited[v] = true;
        path[v] = u;
      }
    }
  }
  return path;
}

function dfs(source, graph=[]) {
  let visited = graph.map(() => false);
  let path = graph.map(() => -1);

  visited[source] = true;
  path[source] = -1;
  let traversal = [];
  traversal.push(source);

  while (!(traversal.length === 0)) {
    let u = traversal.pop();

    for (let v of graph[u]) {
      visited[v] = true;
      traversal.push(v);
      path[v] = u;
    }
  }
  return path;
}

function dfs(source, graph=[], visited=[], path=[]) {
  visited[source] = true;
  for (let destination of graph[source]) {
    if (!visited[destination]) {
      path[destination] = source;
      dfs(source, graph, visited, path);
    }
  }
}

function bubbleSort(arr=[]) {
  let swapped;
  for (let i = 0; i < arr.length - 1; ++i) {
    swapped = false;
    for (let j = 0; j < arr.length - i - 1; ++j) {
      if (arr[j] > arr[j + 1]) {
        [arr[j], arr[j + 1]] = [arr[j + 1], arr[j]];
        swapped = true;
      }
    }
    if (!swapped) {
      break;
    }
  }
}

